import React, { Component } from 'react';

import './search-panel.css';

const SearchPanel = () => {
  return (
    <input
        type="text"
        className="form-control search-input"
        placeholder="type to search"
        onChange={this.onChange}/>
  );
};

export default SearchPanel;
